import React from 'react';
import './style.css';

import { VictoryBar, VictoryChart, VictoryTheme } from 'victory';

const sampleData = [
  {x: "Python", y: 4, label: "4"},
  {x: "Java", y: 5, label: "5"},
  {x: "JS", y: 2, label: "2"},
];

class Skills extends React.Component {
  render() {
    return (
      <VictoryChart>
        <VictoryBar horizontal
          data={sampleData}
          range={[0,5]}
          x="Test"
          y={{label: "Proficiency"}}
        />
      </VictoryChart>
    )
  }
}

export default Skills;
